&lt;br /&gt;
Finished a bag of coffee beans this morning and I chucked it out. But then I felt bad -- it was made of some interesting laminate material and the design work showed some effort. (Red silhouette Vespa, yeah, that takes effort.) So, I ripped it apart and cleaned it up and made a box out of it. Folds not so great -- you really have to crease it. But I figure it's very waterproof.&lt;br /&gt;
&lt;br /&gt;
I was going to go inside and leave it on a table, but I find that Starbucks has this jive-ass policy of not allowing photographs inside their cafés and I didn't want to freak anybody out. Instead, I stuck the box on the windowsill.&lt;/p&gt;

