&lt;p&gt;In Buttermarket, Canterbury outside of the Cathedral, &lt;br /&gt;
&lt;br /&gt;
This awful blot on the landscape Coffee joint is immediately by the Christchurch Gate to the Mother Church of the Anglican Communion - would this be allowed in Rome at St Peters, or in Mecca, or next to any really major religious site in any othe part of the world? There is nothing like this at St Pauls or Westminster Abbey or Cathedral in London, or York Minster, so why allow it here, a centre of pilgrimage for Christians the world over &lt;br /&gt;
&lt;br /&gt;
I consider the A650 Canon to give better results that my G7.&lt;br /&gt;
Look at this large or original size to see the sharpness this little camera delivers&lt;/p&gt;

