&lt;p&gt;I'm puzzled as to what BT Openzone has to do with Starbucks Germany.&lt;br /&gt;
&lt;br /&gt;
BT Openzone is, as far as their site is concerned, not active outside the UK and Ireland.&lt;br /&gt;
They did come to an agreement for the UK and Ireland Starbucks stores to migrate from T-Mobile hotspots to BT Openzone hotspots.&lt;br /&gt;
&lt;br /&gt;
In Germany, Starbucks WiFi was also in the hands of T-Mobile.&lt;br /&gt;
And now this sign is up the window of Starbucks Aachen.&lt;br /&gt;
&lt;br /&gt;
When checking the German Starbucks website, it only mentions a (general) story about the paid WiFi service of, without naming them, T-mobile. There is nothing mentioned about FREE WiFi. Which would be the best crowd puller possible!&lt;br /&gt;
&lt;br /&gt;
So, what's going on with this??&lt;/p&gt;

