&lt;p&gt;Starbucks in Houston!&lt;br /&gt;
So this past year for lent i decided to give up all liquids, except for water, which was astonishingly harder than I thought! (Actually, it was such a good experience! It was so meaningful to me as well because the idea came from LWI, &lt;a href="http://www.water.cc" rel="nofollow"&gt; Living Water Int.&lt;/a&gt;, a non profit organization that I went to Nicaragua with to dig a water well so that a village could have clean water. LWI is VERY close to my heart- one of my favorite non-profits!) But, I made it through all the more thankful for tasty beverages and hot liquids such as coffee. Now that the lent time has come and gone, I can say with all the conviction in the world that I run on coffee, I am infatuated with coffee, I want to live with coffee for the rest of my days!! (A little much?? I don't think so.)&lt;br /&gt;
In CELEBRATION to my old love- that has now been rekindled &lt;a href="http://www.youtube.com/watch?v=XG-3XqcXbbE" rel="nofollow"&gt; jam on!&lt;/a&gt;&lt;br /&gt;
&lt;br /&gt;
Please visit LWI's website to find out more about YOU can help the cause for clean water for everyone! &lt;br /&gt;
FACT: A child dies every 15 seconds because of the lack of clean water. &lt;br /&gt;
FACT: You can help make a difference. Visit &lt;a href="http://www.water.cc" rel="nofollow"&gt;www.water.cc&lt;/a&gt; to find out what Living Water is doing and how you can be a part of the cause!&lt;/p&gt;

