&lt;p&gt;My bank balance sweats every time I'm anywhere near a Starbucks.  So I bought some Discoveries to try at home, and I must admit they are just as good as the 'real deal'. I'm going to try and make my own version of a Jave Chip Frappe later using a mocha Discovery, ice chips and coffee ice cream. Oh and lashings of chocolate chips, whipped cream and chocolate sauce. It may induce a heart attack due to the amount of fat and calories but it'll be worth it...&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/suomynona/"&gt;pouryourheartintoit&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/suomynona/4814866472/" title="Roy Street Coffee &amp;amp; Tea, Seattle"&gt;&lt;img src="http://farm5.static.flickr.com/4076/4814866472_92f7502147_m.jpg" width="180" height="240" alt="Roy Street Coffee &amp;amp; Tea, Seattle" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The rim on the wall reminded me of the rims that were on my Dad's 1978 cobalt blue &lt;a href="http://www.flickr.com/photos/suomynona/3244602873/" target="_blank"&gt;VW Scirocco&lt;/a&gt;. This photo was taken with a &lt;a href="http://www.amazon.com/gp/product/b001wakscw?ie=utf8&amp;amp;tag=dvdlisform&amp;amp;linkcode=xm2&amp;amp;camp=1789&amp;amp;creativeasin=B001WAKSCW" target="_blank" rel="nofollow"&gt;Panasonic GH1&lt;/a&gt; using an ultra wide angle &lt;a href="http://www.amazon.com/gp/product/b0028y5gkk?ie=utf8&amp;amp;tag=dvdlisform&amp;amp;linkcode=xm2&amp;amp;camp=1789&amp;amp;creativeasin=B0028Y5GKK" target="_blank" rel="nofollow"&gt;H-F007014&lt;/a&gt; lens. Although it looks like I used flash, I did not. The light glaring off the middle of the rim is from the overhead halogen lights. Unnecessary in what is an otherwise &lt;a href="http://seattletimes.nwsource.com/html/coffeecity/2010291075_starbucks_opens_roy_street_cof.html" target="_blank" rel="nofollow"&gt;pretty cool&lt;/a&gt; coffee shop.&lt;br /&gt;
&lt;br /&gt;
I had to shoot from a crazy angle due to those halogen lamps catching the shadow of either my noggin or the camera. I almost formatted the disc out of frustration, thinking that I didn't get anything...&lt;br /&gt;
&lt;br /&gt;
&lt;a href="http://www.flickr.com/photos/suomynona/4394254398/" target="_blank"&gt;Proof&lt;/a&gt; that I have a terrible memory. If I ever go back to Roy Street, I hope to remember to order my beverage to go. That way, the coffee will be served in a recyclable cup instead of in a wok-sized ceramic cup that you have to hold with two hands. Ridiculous. In fact, from now on I'll just go to &lt;a href="http://www.urbanspoon.com/r/1/1080" target="_blank" rel="nofollow"&gt;Joe Bar&lt;/a&gt;. While the coffee from the &lt;a href="http://en.wikipedia.org/wiki/Clover_Equipment_Company" target="_blank" rel="nofollow"&gt;Clover&lt;/a&gt; machine at Roy Street may be superior, I am tired of Roy Street's internet being &lt;i&gt;slower&lt;/i&gt; than a 14.4 kbit/s modem.&lt;br /&gt;
&lt;br /&gt;
&lt;b&gt;Sumatra&lt;/b&gt;&lt;br /&gt;
&amp;quot;The island of Sumatra produces 70% of Indonesia's income and is home to over 38 million people. This coffee has a full, syrupy body with virtually no acidity - so the coffee's intensity lingers in your mouth. The concentrated spicy, herbal notes and earthy aroma are the telltale signatures of this well-loved coffee.&amp;quot;&lt;br /&gt;
&lt;br /&gt;
