&lt;p&gt;I was bumming around at my hotel room tonight and didn't feel like going out. Therefore today's shot had to be taken in my hotel room and I came up with &lt;br /&gt;
&lt;br /&gt;
*** bathroom bokeh engineering (BBE) ***&lt;br /&gt;
&lt;br /&gt;
The rules are fairly simply:&lt;br /&gt;
&lt;br /&gt;
* shoot something in your bathroom using only stuff in your bathroom&lt;br /&gt;
&lt;br /&gt;
Here is my setup for tonight featuring &lt;br /&gt;
&lt;br /&gt;
1) &amp;quot;Beach&amp;quot; a.k.a. t-shirt from last night&lt;br /&gt;
2) &amp;quot;Water&amp;quot; a.k.a. transparent wrap around the toothpaste cups&lt;br /&gt;
3) Starbucks cup - leftover from this morning (yes, I do drink coffee in my bathroom ;-) )&lt;br /&gt;
&lt;br /&gt;
* Built-in flash&lt;br /&gt;
* &amp;quot;Help us conserve our natural resources! -  do you need a fresh towel&amp;quot;-paper reflector&lt;br /&gt;
* face mirror reflector&lt;br /&gt;
&lt;br /&gt;
(setup shot see below)&lt;br /&gt;
